VOS_UINT32 AT_TestSetPort(VOS_UINT8 ucIndex)
{
#if(FEATURE_ON == MBB_USB)
    return AT_ERROR;
#else
    VOS_UINT32                          i;
    VOS_UINT16                          usLength;
    VOS_UINT32                          ulRet;
    VOS_UINT32                          ulAvailablePortTypeNum;
    VOS_UINT8                           aucAvailablePortType[AT_SETPORT_PARA_MAX_LEN];
    VOS_UINT8                           ucPortIndex;


    ulAvailablePortTypeNum = 0;



    PS_MEM_SET(aucAvailablePortType, 0x00, sizeof(aucAvailablePortType));

    ulRet = (VOS_UINT32)DRV_USB_GET_AVAILABLE_PORT_TYPE(aucAvailablePortType, &ulAvailablePortTypeNum, AT_SETPORT_PARA_MAX_LEN);
    if (VOS_OK != ulRet)
    {
        return AT_ERROR;
    }

    usLength = 0;

    for (i = 0; i < ulAvailablePortTypeNum; i++)
    {
        ulRet = AT_GetPortInfoIndex(aucAvailablePortType[i], &ucPortIndex);
        if (VOS_OK != ulRet)
        {
            return AT_ERROR;
        }

        /*^SETPORT:*/
        usLength += (VOS_UINT16)At_sprintf(AT_CMD_MAX_LEN,
                                        (VOS_CHAR *)pgucAtSndCodeAddr,
                                        (VOS_CHAR *)pgucAtSndCodeAddr + usLength,
                                        "%s:",
                                        g_stParseContext[ucIndex].pstCmdElement->pszCmdName);

        /*参数*/
        usLength += (VOS_UINT16)At_sprintf(AT_CMD_MAX_LEN,
                                        (VOS_CHAR *)pgucAtSndCodeAddr,
                                        (VOS_CHAR *)pgucAtSndCodeAddr + usLength,
                                        "%s: %s",
                                        g_astSetPortParaMap[ucPortIndex].aucAtSetPara,
                                        g_astSetPortParaMap[ucPortIndex].aucAtDispPara);

        if (i < (ulAvailablePortTypeNum - 1))
        {
            /*回车换行*/
            usLength += (VOS_UINT16)At_sprintf(AT_CMD_MAX_LEN,
                                            (VOS_CHAR *)pgucAtSndCodeAddr,
                                            (VOS_CHAR *)pgucAtSndCodeAddr + usLength,
                                            "%s",gaucAtCrLf);
        }
    }

    gstAtSendData.usBufLen = usLength;

    return AT_OK;
#endif
}
